import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
// USERS is an array of objects, which we need to convert into JSX (javascript components)
import { users } from "../data";


const employeeTable = users.map((users) => <table key={users.id}>{users.name}{users.department}{users.role}{users.email}</table>);

function Headline() {

    return (
        <div>
          {employeeTable}  
        </div>
    );
}

